    1,nt"name": "bike-facilities",nt"isopen": false,nt"url": null,nt"notes":
    "<p>All categories of bicycle facilities in Jefferson County. These include Bike
    Lanes, Shared Use Paths, roads with shared lane markings, signed bike routes, and
    offroad cycling trails. These are the facilities that currently on the ground. Most
    include a date showing when the facility was installed. Also included for many of
    these is a direction of travel as an indication of which side of the roadway is
    impacted. Plan type is an attribute describing a more specific description of the
    type of facility, whereas map type is a broader description and an attribute used
    for symbology.</p>n",nt"owner_org": "72add7c8-b5ff-4e2e-9fa8-ee9d72e25038",nt"extras":
